  grid-column-end: 3;
  text-align: center;
}

.kontaktKundeservice {
  grid-row-start: 2;
  grid-column-start: 1;
  grid-column-end: 3;
  text-align: center;
}

.kontaktKundeservice p {
  margin-block-start: 0px;
  margin-block-end: 10px;
}

.kundeserviceKnap {
  height: 40px;
  font-family: "Lato", sans-serif;
  font-weight: 800;
  background-color: white;
  border: none;
  padding: 10px;
  border-radius: 5px;
  cursor: pointer;
  margin-bottom: 5px;
}

.kundeserviceKnap a {
  color: black;
}

#footerSponsor {
  background-color: white;
}

.sponsorbar {
  width: 90%;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 1fr 1fr 1fr 1fr;
}

.sponsor {
  width: 50px;
  height: 50px;
  margin: 0 auto;
  margin-top: 10px;
}

.sponsor img {
  width: 100%;
}

.stopSpillet {
  padding-top: 10px;
  width: 50px;
  height: 50px;
  margin: 0 auto;
}

.wlaLogo {
  width: 50px;
  height: 50px;
  margin: 0 auto;
  padding-top: 10px;
}

@media screen and (min-width: 627px) {
  .casinoLogo {
    text-align: center;
  }
  .logInd {
    width: 90%;
  }
  #containerIndhold {
    margin-top: -480px;
  }
  .alien {
    height: 25vh;
  }
  .rumRejsenSkilt {
    top: -5vw;
    position: absolute;
  }
  .ikoner {
    grid-template-columns: 1fr 1fr 1fr;
  }
  .ikon {
    width: 25vw;
  }
}

@media screen and (min-width: 768px) {
  .logoDesktop {
    width: 150px;
    padding: 10px 10px 10px 20px;
  }
  .dsLogoMobil {
    display: none;
  }
  .dsLogoDesktop {
    display: block;
  }
  .kampangeBillede {
    height: 975px;
  }
  #containerIndhold {
    margin-top: -600px;
  }
  .alien {
    height: 30vh;
    top: 10vw;
  }
  .ikon {
    width: 150px;
    height: 150px;
  }
  .ikoner {
    margin-bottom: 4vw;
  }
  .videoContainer {
    display: grid;
    grid-template-columns: 1fr 1fr;
    grid-gap: 20px;
  }
  .textContainer {
    grid-template-columns: 1fr 1fr 1fr 1fr;
    grid-gap: 20px;
  }
  .text {
    width: 20vw;
    text-align: left;
    margin-top: 0vw;
  }
  .textAdresse {
    grid-column-start: 1;
    grid-column-end: 2;
    text-align: left;
  }
  .kontaktKundeservice {
    grid-column-start: 4;
    grid-column-end: 5;
    grid-row-start: 1;
    text-align: left;
  }
  .kundeserviceKnap {
    padding: 5px;
  }
  .footerLogo {
    margin-left: 0px;
  }
}

@media screen and (min-width: 1024px) {
  .kampangeBillede {
    height: 1290px;
  }
  #containerIndhold {
    margin-top: -780px;
  }
  .alien {
    height: 40vh;
    top: 10vw;
  }
  .textKampange {
    width: 65%;
  }
  .textKampange p {
    width: 100%;
    font-size: 1em;
    line-height: 23px;
  }
  .ikoner {
    width: 65%;
    grid-gap: 25px;
  }
  .ikon {
    width: 18vw;
    height: 18vw;
  }
  .videoContainer {
    width: 65%;
  }
  .textContainer {
    width: 90%;
  }
  .sponsorbar {
    width: 60%;
  }
}

