.modal {
  display: none;
  /* Hidden by default */
  position: fixed;
  /* Stay in place */
  z-index: 100;
  /* Sit on top */
  left: 0;
  top: 0;
  width: 100%;
  /* Full width */
  height: 100%;
  /* Full height */
  overflow: auto;
  /* Enable scroll if needed */
  background-color: black;
  /* Fallback color */
  background-color: rgba(0, 0, 0, 0.7);
  /* Black w/ opacity */
}

.modal .container {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-gap: 3vw;
  margin: 4vw;
}

.modal .container img {
  width: 15vw;
  animation: puls 0.5s infinite alternate;
}

@keyframes puls {
  from {
    transform: scale(1);
  }
  to {
    transform: scale(1.1);
  }
}

/* Modal Content/Box */
.modal-content {
  margin: 15% auto;
  /* 15% from the top and centered */
  width: 80%;
  /* Could be more or less, depending on screen size */
}

